from typing import List

def remove_duplicates(numbers: List[int], allow_consecutive_duplicates: bool=False) -> List[int]:
    if len(numbers) == 0:
        return []
    if allow_consecutive_duplicates:
        new_length = 1
        for i in range(1, len(numbers)):
            if numbers[i] != numbers[new_length - 1]:
                numbers[new_length] = numbers[i]
                new_length += 1
    else:
        seen = set()
        new_length = 0
        for i in range(len(numbers)):
            if numbers[i] not in seen:
                seen.add(numbers[i])
                numbers[new_length] = numbers[i]
                new_length += 1
    return numbers[:new_length]

